import React, {useState} from 'react';
import axios from 'axios';


export default () =>{
    const[message, setMessage] = useState('');
    const[name, setName] = useState('');
    const[email, setEmail] = useState('')

    const formSubmit = (e, data) =>{
        console.log('nothing')
    }


    return(
        <div className='col-12 text-center mt-5'>
            <form className="col-sm-6 form" onSubmit={(e) => {formSubmit(e, message, email, name)}}>

                <div className='form-group'>
                    <textarea onChange={(e) => setMessage(e.target.value)} name="message" className='form-control' type="text" placeholder="Please write your message here" required/>
                </div>

                <div className='form-group'>
                    <input onChange={(e) => setName(e.target.value)} name="name" type="text" className='form-control' placeholder="Your Name" required/>
                </div>

                <div className='form-group'>
                    <input onChange={(e) => setEmail(e.target.value)} name="email" type="email" className='form-control' placeholder="your@email.com" required/>
                </div>

                <button className="btn btn-primary">Contact Me!</button>

            </form>
        </div>
    )
}
